   key = 469caede37e5336f...adb131458c3 , 
   idControlador = 1d473b41-7136-4b1d-a077-3dc17828c225 , 
   content = f09138a8a9113e57c30994221cb6ed...671ad94f9870d97a69cf41c3c1105189 
}      Campo  Tipo  Descrição      key  Texto  Chave simétrica a ser usada para descriptografar os dados do campo  content . Essa chave deve ser descriptografada com a chave privada de quem a recebeu    idControlador  UUID  Identificador do Controlador    content  Texto  Um  envelope  que foi criptografado com a chave do campo key

